      body {

        flex-wrap: wrap;
        justify-content: center;
        height: 100vh;
        margin: 0;
      }
      img {
        width: 100%;
      }
      .person {
        align-items: center;
        display: flex;
        flex-direction: column;
        width: 280px;
      }
      .container {
        border-radius: 50%;
        height: 312px;
        -webkit-tap-highlight-color: transparent;
        transform: scale(0.48);
        transition: transform 250ms cubic-bezier(0.4, 0, 0.2, 1);
        width: 400px;
      }
      .container:after {
        background-color: #f2f2f2;
        content: '';
        height: 10px;
        position: absolute;
        top: 390px;
        width: 100%;
      }
      .container:hover {
        transform: scale(0.54);
      }
      .container-inner {
        clip-path: path(
          'M 390,400 C 390,504.9341 304.9341,590 200,590 95.065898,590 10,504.9341 10,400 V 10 H 200 390 Z'
        );
        position: relative;
        transform-origin: 50%;
        top: -200px;
      }
      .circle {
        /* background-color: #fee7d3; */
        border-radius: 50%;
        height: 380px;
        left: 10px;
        pointer-events: none;
        position: absolute;
        top: 210px;
        width: 380px;
      }
      .img {
        pointer-events: none;
        position: relative;
        transform: translateY(20px) scale(1.15);
        transform-origin: 50% bottom;
        transition: transform 300ms cubic-bezier(0.4, 0, 0.2, 1);
      }
      .container:hover .img {
        transform: translateY(0) scale(1.2);
      }
      .divider {
        background-color: #ca6060;
        height: 1px;
        width: 160px;
      }
      .name {

      .logo {

        font-weight: 600;
        margin-top: 16px;
        text-align: center;
        cursor: pointer;
      }
      .title {
        color: #6e6e6e;
        font-family: arial;
        font-size: 14px;
        font-style: italic;
        margin-top: 4px;
